import { Link } from "react-router-dom";

function Main() {
    return (
        <div style={{ textAlign: "center" }}>
            <h1>IoT 환경 관리 시스템</h1>
            <p>원하는 기능을 선택하세요:</p>
            <Link to="/temp"><button>온습도</button></Link>
            <Link to="/dust"><button>미세먼지</button></Link>
            <Link to="/report"><button>보고서</button></Link>
        </div>
    );
}

export default Main;
